DROP TRIGGER IF EXISTS `update_movimientofiesta_after_fiesta_update`;
DELIMITER $$
CREATE TRIGGER `update_movimientofiesta_after_fiesta_update` AFTER UPDATE ON `modulo_evento_fiesta` FOR EACH ROW BEGIN
    DECLARE admin_id INT;
    DECLARE descripcion TEXT DEFAULT '';
    DECLARE cambio BOOLEAN DEFAULT FALSE;
    DECLARE old_nombre, new_nombre VARCHAR(255);
    DECLARE old_descripcion, new_descripcion TEXT;
    DECLARE old_edad_minima, new_edad_minima INT;
    DECLARE old_edad_maxima, new_edad_maxima INT;

    -- Obtener el id del administrador (puede ser a través de una variable de sesión)
    SET admin_id = @admin_id;

    -- Obtener los valores antiguos del evento (antes de la actualización) de la tabla `modulo_evento_evento`
    SELECT _nombre, _descripcion, _edad_minima, _edad_maxima
    INTO old_nombre, old_descripcion, old_edad_minima, old_edad_maxima
    FROM `modulo_evento_evento`
    WHERE id = OLD.evento_ptr_id;

    -- Obtener los valores nuevos del evento (después de la actualización) de la tabla `modulo_evento_evento`
    SELECT _nombre, _descripcion, _edad_minima, _edad_maxima
    INTO new_nombre, new_descripcion, new_edad_minima, new_edad_maxima
    FROM `modulo_evento_evento`
    WHERE id = NEW.evento_ptr_id;

    -- Detectar cambios en los campos de Fiesta
    IF NEW._vestimenta <> OLD._vestimenta THEN
        SET descripcion = CONCAT(descripcion, 'Vestimenta cambió de ', OLD._vestimenta, ' a ', NEW._vestimenta, '; ');
        SET cambio = TRUE;
    END IF;

    IF NEW._categoria <> OLD._categoria THEN
        SET descripcion = CONCAT(descripcion, 'Categoría cambió de ', OLD._categoria, ' a ', NEW._categoria, '; ');
        SET cambio = TRUE;
    END IF;

    IF NEW._cantidad_entrada_popular <> OLD._cantidad_entrada_popular THEN
        SET descripcion = CONCAT(descripcion, 'Cantidad de entradas populares cambió de ', OLD._cantidad_entrada_popular, ' a ', NEW._cantidad_entrada_popular, '; ');
        SET cambio = TRUE;
    END IF;

    IF NEW._cantidad_entrada_vip <> OLD._cantidad_entrada_vip THEN
        SET descripcion = CONCAT(descripcion, 'Cantidad de entradas VIP cambió de ', OLD._cantidad_entrada_vip, ' a ', NEW._cantidad_entrada_vip, '; ');
        SET cambio = TRUE;
    END IF;

    -- Solo inserta en MovimientoFiesta si hubo un cambio
    IF cambio THEN
            `_fecha`, 
            `_descripcion`, 
            `_administrador_id`, 
            `_fiesta_id`
        )
        VALUES (
            NOW(),
            descripcion,
            admin_id,
            NEW.evento_ptr_id
        );
    END IF;
END
$$
DELIMITER ;

